Jackie And Jill (Vivid) [DVDRip]

Julie Robbins, Karina, Kira Kener, Lezley Zen, Lili Thai

A modern day fairy tale. Kira is looking for love in all the wrong ads. Dating services, internet, newspapers, all to no avail. And then something wild happened: In her search for the perfect man, she found the perfect woman. Paul Thomas, adult's most awarded director presents Vivid superstar Kira in Jackie and Jill, a fable of forbidden love. A fairy tale of fairies, if you will. And guess what...they all live happily ever after.

